import * as React from "react";
import { createStackNavigator } from "@react-navigation/stack";

//Screens
import HomeScreen from "./screens/HomeScreen";
import ChatScreen from "./screens/ChatScreen";
import SettingsScreen from "./screens/SettingsScreen";
import JobDetails from "./screens/JobDetails";
import PostJob from "./screens/PostJob";

const Stack = createStackNavigator();

//Screen names
const homeName = "JobList";
const chatsName = "Chat ";
const settingsName = "Settings ";

const HomeStackNavigator = () => {
    return (
        <Stack.Navigator>
            <Stack.Screen name={homeName} component={HomeScreen} />
            <Stack.Screen name="JobDetails" component={JobDetails} />
            <Stack.Screen name="PostJob" component={PostJob} />
        </Stack.Navigator>
    );
};
const DetailsStackNavigator = () => {
    return (
        <Stack.Navigator>
            <Stack.Screen name={detailsName} component={DetailsScreen} />
        </Stack.Navigator>
    );
};
const SettingsStackNavigator = () => {
    return (
        <Stack.Navigator>
            <Stack.Screen name={settingsName} component={SettingsScreen} />
        </Stack.Navigator>
    );
};

export { HomeStackNavigator, DetailsStackNavigator, SettingsStackNavigator };
